import './App.css';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import Createuser from './Components/Createuser';
import Users from './Components/Users';
const App=()=>{
return(
  <BrowserRouter>
  <Routes>
    <Route path="/createuser" element={<Createuser />}/>
    <Route path="/Users" />
  </Routes>
  </BrowserRouter>
)
}
export default App;
